import React from 'react';
import './buttons.css';
import {link} from 'react-router-dom'

function Nave() {
  return (
            <>
                <p className='button'>Home</p>
                <p className='button'>About</p>
                <p className='button'>Cities</p>
            </>
  );
};

export default Nave;
